      SELECT 88 FROM tab0 (FORMAT parquet) WHERE NOT ( - ( + + col1 ) ) + + 48 IN ( - ( 75 ), + col1, - col1, + 80 );
  - name: tab0

outputs:
  - name: q11894.out
    data: |
      88
      88
      88
